(28200, 1476, 2808, 1, 'Clap your hands!', '', '2010-10-02 00:00:00', 2010, 0, 2, 6, '最近心中總有很多怨言\r\n但不知如何將它忘卻\r\n每天過著規律如一的生活\r\n都快要忘了自己是誰\r\n\r\n找一晚我們爬上屋簷\r\n或 找一天走到一片草原\r\n不要忘了今晚的秘密聚會\r\n把自己遺忘在音樂\r\n\r\n一場沒有名字的宴會這一晚\r\n是我們一起共渡的時間\r\n不 管隔壁站的是誰\r\n我們一同擁有的世代\r\n卻距離自由越來越遠\r\n\r\n(酒多喝點讓自己更醉\r\n跟著音樂 跳高點讓自己忘卻\r\n我 們用力熱愛的搖滾樂\r\n一首歌讓我們能避開\r\n被利益包圍的資本社會)\r\n\r\nHey! 派對到無法無天\r\nHey! 像是沒有明天\r\n攤在地板或尖叫發洩\r\n沒有誰能限制快樂湧現\r\n\r\nHey! 派對到無法無天\r\nHey! 明天也許不會再見\r\n我們擁有搖滾樂\r\n別裝冷靜來加入我的行列\r\n\r\nHey! 派對到無法無天\r\nHey! 只有一首歌時間\r\n就算別人不懂這種音樂\r\n就讓我們多把握這時間\r\n\r\nHey! 派對到無法無天\r\nHey! 就算沒有明天\r\n瞎鬧放肆舉高雙手\r\n準備好來跟我一起冒險 來恣意妄為', '', 300, '', '', '', '', '', '', 0, 0, 1, '2010-10-02 00:14:25', '2013-10-07 17:17:06', '0000-00-00 00:00:00'),
