(28202, 79820, 0, 1, '吉他牧羊人之歌(demo)', '', '0000-00-00 00:00:00', 2000, 0, 2, 7, '', '', 183, '', '', '', '', '', '', 0, 0, 1, '2010-10-03 03:36:53', '2013-10-07 17:17:06', '0000-00-00 00:00:00'),
(28203, 79820, 0, 1, '吉他牧羊人之歌(demo)', '我在巴勒斯坦的曠野中牧羊，領著羊群\r\n逐著水草四處遷徙。想念的卻是我心頭上的蘇拉密女。\r\n走著走著，不知不覺日落了，但我極害怕黑暗。\r\n好險傍晚時天邊轉上來了一圓美麗的銀色盤子，它做了我腳前的燈、路上的光，它為我忠實地懸著\r\n\r\n緩緩上升，直到東方重現日光才在遠方落下。\r\n\r\n \r\n到了一片平坦的原野，而視線的盡頭隨著我向前，悄悄地浮出了一座小城，我趕上前去，因為\r\n那裡說不定有你的消息。沒想到昔日繁華的城堡早已頹敗荒涼，空蕩蕩的。失落地我輕輕跪了下來，從行囊中探出了幾株香草和一瓶極珍貴的乳香。闔上眼睛我默默祈求你能聽到我所有想對你說的話。\r\n\r\n起身後我唱起了一首歌，聲音被傳得遠遠的，出了城門發現荒野也正在重複著我的歌聲。\r\n\r\n \r\n而我終於能快樂，即使獨步踏上一個沒有你的旅程。\r\n', '2010-10-03 00:00:00', 2000, 0, 1, 4, '我是一個小小的牧羊人\r\n游牧在草場上等苦等\r\n等著銀盤子做我的明燈\r\n游牧在草場上等枯等\r\n我是一個小小的牧羊人\r\n游牧在草場上等苦等\r\n等著銀盤子做我的明燈\r\n等呀等等 靜靜等\r\n寂寞的歌聲叫醒很遠很遠寂寞的城\r\n遺落後我如何將瑣語傳真\r\n平原上空蕩得沒有文明的可能\r\n平原上空蕩得沒有文明的可能\r\n當我越陷越深你會在哪個城角等我的吻\r\n你是否也會在草場上和我ㄧ起唱歌', '', 177, '', '吳昀慶', '吳昀慶', '女伶', '', '', 0, 1, 0, '2010-10-03 03:49:09', '2015-03-12 13:43:51', '0000-00-00 00:00:00'),
(28204, 58111, 0, 1, '想飛的季節', '台東縣政府「想飛的季節」系列活動歌曲', '2010-10-03 00:00:00', 2010, 0, 2, 4, '209　想飛的季節　201010011635\r\n\r\n你是否厭倦現在的生活\r\n想要來點不同\r\n你是否後悔曾有的夢想\r\n沒有緊緊把握\r\n\r\n走吧走吧走吧走吧走吧\r\n尋找嚮往的自由\r\n我想我想我想我想我想\r\n抓住消失的彩虹\r\n\r\n在這想飛的季節\r\n白白的浪花敲醒了我的夢想\r\n我的世界不該只是這樣\r\n充滿著慌張和徬徨\r\n\r\n想飛的季節\r\n蔚藍的天空擁抱燦爛的陽光\r\n我的世界應該充滿希望\r\n有著無限的想像\r\n想飛的季節\r\n\r\n---------------------------------------------\r\n\r\n演唱：國銘\r\n詞　：國銘\r\n曲　：國銘\r\n編曲：國銘\r\n吉他：國銘\r\n貝斯：國銘\r\n鼓　：國銘\r\n錄製：國銘\r\n\r\n俊美小鋒的房間製作\r\n\r\n---------------------------------------------\r\n', '', 218, '', '江國銘', '江國銘', '江國銘', '', '', 0, 1, 0, '2010-10-03 13:44:29', '2015-03-12 13:43:51', '0000-00-00 00:00:00'),
