(28206, 84478, 2911, 5, '乎阿嬤的批', '生命之作\r\n\r\nhttp://www.wretch.cc/blog/diegodtk/8773311', '2010-09-19 00:00:00', 2000, 20, 0, 4, '在我還細漢的時候\r\n\r\n阿嬤就帶我到現在\r\n\r\n在十八歲那年\r\n\r\n離開高雄 到台北\r\n\r\n一天過一天 才知道\r\n\r\n一個人不簡單\r\n\r\n我每晚嘛想起 阿嬤說的話\r\n\r\n在台北打拼 就要小心 不通去被騙\r\n\r\n我都嘛有聽 丟愛賺大錢 讓家裡面過好日子\r\n\r\n阿嬤 請你不要煩惱 我在台北 認真打拼\r\n\r\n也會好好照顧自己\r\n\r\n阿嬤 請你就要保重 不要太操煩 等我回去\r\n\r\n在你的身邊\r\n\r\n我的阿嬤\r\n\r\n一天過一天 才知道\r\n\r\n一個人不簡單\r\n\r\n我常常嘛想起 阿嬤說的話\r\n\r\n在台北生活 就要吃飽 衣服要穿多一點\r\n\r\n我都嘛有聽 愛賺大錢 讓家裡面過好日子\r\n\r\n阿嬤 請你不要煩惱 我在台北 認真打拼\r\n\r\n也會好好照顧自己\r\n\r\n阿嬤 請你就要保重 不要太操煩 等我回去\r\n\r\n在你的身邊\r\n\r\n我的阿嬤', '', 298, '', '陳零九', '陳零九', '周佳佑 陳零九', 'T-Work', '', 0, 1, 0, '2010-10-04 11:53:22', '2015-03-12 13:43:51', '0000-00-00 00:00:00'),
