(28211, 60018, 0, 1, 'F.J - 本來是兩個人_T.P.K', '這首歌,本來是兩個人,描述情人分手之後的心情\r\n是一首失戀情歌,本來是兩個人,最後剩下一個人過,一個人生活\r\n本來是兩個最熟悉的戀人,分手後成了最熟悉的陌生人\r\n來自TPK 的F.J 所呈現給各位!\r\n\r\n希望大家能夠喜歡!', '2010-10-04 00:00:00', 2000, 0, 1, 2, 'F.J - 本來是兩個人_T.P.K\r\n\r\n詞: FJ 曲: FJ\r\n\r\n**\r\n當你離開 我什麼話都不會再說\r\n看著你走  什麼話都放在心裡\r\n既然 你要這樣放我一個人走\r\n未來還有多少夜裡讓我一個人過\r\n\r\n1.\r\n看著爭吵時候我們給對方的傷害\r\n兩個人的相處原本 是這麼依賴\r\n打從心裡我就不 想這樣但是\r\n此刻 溝通不慎掉入分手陷阱\r\nyou hate me I love you \r\n最難忘記的是妳的臉頰帶眼淚\r\n妳說 最難忘記的是我給的承諾\r\n我不想要分手但是妳選擇沉沒\r\n本來是兩個人\r\n手機裡的照片妳說妳不想再看到\r\n但是我卻  遲遲沒有刪掉\r\n牽手與分手 來自同一雙手\r\n發生什麼問題要妳這樣非得要走\r\n妳走的時候 我還 傻傻的放空\r\n一個人的時候就像風箏斷了線\r\n沒了 妳帶走什麼 我永遠記得\r\n我還有什麼 我只能說\r\n\r\n**\r\n當你離開 我什麼話都不會再說\r\n看著你走  什麼話都放在心裡\r\n既然 你要這樣放我一個人走\r\n未來還有多少夜裡讓我一個人過\r\n\r\n妳告訴我要堅強 妳永遠會支持我\r\n但是在我世界沒了妳我還有什麼\r\n有時候打給妳卻已經找不到了話題\r\n有時候路上還會想起妳的身影\r\n那畫面停止前  還想看多少遍\r\n菸我抽的更兇每天抽了又抽\r\n於是我選擇 每天都讓自己買醉\r\n但是醉了又醉妳還  是最難忘(的)\r\n(恩)妳記不記得我們會一起說(的)\r\n本來是兩個人說著要一起過\r\nI need you I miss you My tattoo for pass\r\n為什麼妳會 這樣讓我非常想念\r\n從過去到現在我不敢去想未來\r\n我已經回改 但是已經來不及\r\n我想了再多遍妳還是不會回來\r\nso 算了吧 我們是陌生人 忘了吧\r\n\r\n**\r\n當你離開 我什麼話都不會再說\r\n看著你走  什麼話都放在心裡\r\n既然 你要這樣放我一個人走\r\n未來還有多少夜裡讓我一個人過\r\n**\r\n一個人過  本來是兩個人\r\n\r\n', '', 244, '', 'F.J', 'F.J', 'F.J', 'T.P.K', '', 0, 0, 0, '2010-10-05 04:58:50', '2015-03-12 13:43:51', '0000-00-00 00:00:00'),
