(28239, 60320, 0, 1, '蛻變', '在這個社會上每一個人都有他成長的經歷過程，有快樂，有悲傷\r\n\r\n這是一首關於夢想、信念的歌曲\r\n\r\n送給在台灣這個環境奮鬥的音樂人\r\n\r\n也送給所有 有夢想並且堅持的人', '2010-10-06 00:00:00', 2000, 0, 2, 9, '命運的考驗　誰將殘缺　　\r\n自尊將被 無情徹底的踐踏 摧毀\r\n殘酷的磨鍊　戲謔意識\r\n崩潰\r\n\r\nthat''s my fear (那是我的恐懼)\r\nI want, to know my fate (但我想知道我的宿命) \r\nCan you see, (你可以看見) \r\nI am shivering…(我顫抖著)\r\n\r\n在蛻變之前　誰的箴言 \r\n戲謔的火燄 豪不留情的燃燒尊嚴\r\n睜大的雙眼 親眼看見\r\n那曙光下 蛻變後所留下的繭\r\n\r\nthat''s my fear (那是我的恐懼)\r\nI want, to know my fate (但我想知道我的宿命) \r\nCan you see, (你可以看見) \r\nI am shivering…(我顫抖著)\r\n\r\nI will never start out (我從不妥協) \r\nI was never scared (我從不畏懼) \r\nTake my breath away (我屏息以待)\r\nlook at me (看著我吧)\r\n\r\n寬恕 憎恨以及愛得盲目\r\n機會不停駐\r\n蝴蝶 飛翔前的苦\r\n將破蛹而出\r\n\r\nthat''s my fear(那是我的恐懼\r\nI want, to know my fate(我想知道我的宿命 \r\nI never scared(我從不畏懼 \r\nCan you see,(你可以看見 \r\nI am shivering…(我顫抖著\r\n\r\n看見 未來的畫面\r\n儘管路途有些遙遠\r\n感受 燃燒的聽覺\r\n那是我 內心祈禱的聲音\r\n\r\n', '', 253, '', '阿丁', 'Kenny', '阿丁', '', '', 0, 0, 1, '2010-10-06 13:55:52', '2013-10-07 17:17:06', '0000-00-00 00:00:00'),
(28240, 60320, 0, 1, 'The flower of other shore(彼岸花)', '彼岸花開，花不見葉，有葉無花，花葉兩不見，生生彼岸相錯。\r\n傳說中此花花開一千年，葉長一千年，花葉永不相見。曼珠沙華，又稱彼岸花，一般認為是生長在三途河邊的接引之花，花香傳說有魔力，能喚起死者生前的記憶。\r\n這首歌拿來述說一段沒有結果的愛情', '2010-10-06 00:00:00', 2000, 0, 2, 9, '絕望的詩篇述說著破碎的章節\r\n花盛開時葉卻枯萎\r\n曼珠沙華的悲鳴 背傷的耀眼\r\n葉茂盛時花卻凋謝\r\n\r\n彼岸的悲戀\r\n金黃的淒美\r\n守護著永世的思念\r\n花葉 卻永不相見\r\n\r\n殘破的意念想著無法實現的誓言\r\n金色的花 含淚凋謝\r\n花和葉 那殘酷無情的寓言\r\n逐漸凋謝 悲傷的葉\r\n\r\n彼岸的悲戀\r\n金黃的淒美\r\n守護著永世的思念\r\n花葉 卻永不相見\r\n\r\n渴望 突破界線\r\n渴望 衝破宿命的捆綁\r\n\r\n絕望裡殘留的思念\r\n渴望幸福的意念\r\n葉子的枯萎卻換來花的耀眼\r\n是犧牲還是成全\r\n等待相見的那天\r\n幸福卻只是自以為\r\n\r\n凋謝 彼岸的思念\r\n枯萎 卻依然耀眼', '', 316, '', '小丑 / 阿丁', 'Kenny', '', '', '', 0, 0, 1, '2010-10-06 13:56:37', '2013-10-07 17:17:06', '0000-00-00 00:00:00'),
(28241, 60320, 0, 1, 'volver a casa(尋岸)', '紀念一個被愛傷害到體無完膚最後選擇自我了斷的女孩\r\nvolver a casa是西班牙文"回家"的意思\r\n這是我因為她學到的第一句...也是最後一句\r\nBy.Kenny', '2010-10-06 00:00:00', 2000, 0, 2, 9, '蒼白的牆   卻無法粉飾傷害\r\n殘破不堪的愛\r\n每當期待  卻再次被掩埋 \r\n說好的未來  早已不存在\r\n\r\n記憶片段是無期的刑判\r\n漂流的花遺失靠岸\r\n\r\n（副）\r\n冰冷的枕邊  無助蔓延  \r\n不斷上演  墬落瞬間\r\n回憶畫面　浮現眼前\r\n\r\n\r\n重複的背叛\r\n遺失的感官\r\n枯萎的花\r\n殞落在彼岸\r\n\r\n\r\n記憶片段是無期的刑判\r\n追憶卻成自我傷害\r\n\r\n我不在為誰期待\r\n虛偽的愛\r\n粉碎期盼\r\n（副）\r\n冰冷的枕邊  無助蔓延  \r\n不斷上演  墬落瞬間\r\n回憶畫面　浮現眼前\r\n\r\n曾以為　墜落後就能展翅高飛\r\n寂寞仍然在指間\r\n\r\n唇邊殘留著那艷紅的鮮血\r\n胸前刺痛著 提醒傷口在蔓延\r\n迷霧的淚 流出痛苦的瞬間\r\n冰冷的話 失魂後的心碎\r\n\r\n\r\n（副）\r\n冰冷的枕邊  無助蔓延  \r\n不斷上演  墬落瞬間\r\n回憶畫面　浮現眼前\r\n\r\n無法挽回的遺憾\r\n心碎找不到靠岸\r\n曾經許下的未來\r\n我該如何期盼\r\n無法挽救的傷害\r\n時間無法沖淡\r\n面目　全非\r\n我的愛已腐爛\r\n', '', 288, '', '阿丁', 'Kenny', '', '', '', 1, 0, 0, '2010-10-06 13:57:16', '2015-03-12 13:43:52', '0000-00-00 00:00:00'),
