(28243, 60320, 0, 1, 'Repent(反省)', '一個不珍惜不尊重生命的叛逆少年的自白\r\n生命只有一次\r\n我們往往無法預知任何的意外\r\n所以...我們應當把握當下的任何一分一秒', '2010-10-06 00:00:00', 2000, 0, 2, 7, '公路閃爍街燈　感受風壓吹著\r\n單純的我　我已忘了\r\n自以為的狂傲　被空氣嘲笑著\r\n悲慟的心  卻麻痺了\r\n\r\n淚流了那又如何\r\n這記烙印　燒著傷痕\r\n迷失了那又如何\r\n走到終點　我卻飲恨\r\n\r\n原來我被世界遺棄了\r\n原來追求的　只是空殼\r\n直到最後一刻依然墮落著\r\n眷戀的硬撐著\r\n\r\n不斷閃爍的霓虹燈　我被空氣摧殘著\r\n曾經天真單純的我\r\n無奈間　我遺忘了\r\n自以為的驕傲　被命運戲弄嘲笑著\r\n純真的心遺失了\r\n\r\n淚流了那又如何\r\n這記烙印　燒著傷痕\r\n迷失了那又如何\r\n走到終點　我卻飲恨\r\n\r\n原來我被世界遺棄了\r\n原來追求的　只是空殼\r\n直到最後一刻依然墮落著\r\n眷戀的硬撐著\r\n\r\n這世界　有太多曲折\r\n我在回憶間　卻仍然在現實中　遺失了\r\n只為證明　在世上　存在著\r\n我抓住了什麼', '', 284, '', '阿丁', 'Kenny /  阿丁', '', '', '', 0, 0, 1, '2010-10-06 13:58:29', '2013-10-07 17:17:06', '0000-00-00 00:00:00'),
