(28247, 60320, 0, 1, '未命名(無Bass)', '關於家庭暴力的一首歌曲', '2010-10-06 00:00:00', 2000, 0, 2, 9, '厄夜來臨 無助 侵襲著心\r\n傷痕佈滿心底\r\n\r\n深夜裡　重蹈覆轍的暴力\r\n如何　能結束這場悲劇\r\n眼淚裡　種下痛苦的基因\r\n冰冷無情的打擊\r\n\r\n愛恨已如履薄冰\r\n嘲笑著現實 了無生趣\r\n徒留我至身泥濘\r\n人 間 煉 獄\r\n(副)\r\n那無情　的宣洩\r\n傷害著那些情感線\r\n不停歇　他從不曾停歇\r\n哭喊著　淚崩潰\r\n該如何終結那一天\r\n我會從傷害中學會飛\r\n\r\n夜幕低垂　溫暖的表面崩毀　\r\n愛的誓言　危機在枕邊共眠\r\n心的疲憊　破碎的諾言\r\n只容的下淚水\r\n輪　迴　無　限\r\n(副)\r\n那無情　的宣洩\r\n傷害著那些情感線\r\n不停歇　他從不曾停歇\r\n哭喊著　淚崩潰\r\n該如何終結那一天\r\n我會從傷害中學會飛\r\n\r\n吞噬我　殺害我\r\n\r\n殘暴懦弱貪婪的魔　無情啃食著我的血肉\r\n\r\n(副)\r\n那無情　的宣洩\r\n傷害著那些情感線\r\n不停歇　他從不曾停歇\r\n哭喊著　淚崩潰\r\n該如何終結那一天\r\n我會從傷害中學會飛', '', 266, '', '阿丁', 'Kenny /  阿丁', '阿丁', '', '', 0, 0, 1, '2010-10-06 14:12:20', '2013-10-07 17:17:06', '0000-00-00 00:00:00'),
